import {BrowserRouter as Router,Routes,Route,Link} from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
  <>
  <div>
  <Link to="/home">Home</Link>
  </div>

  <Router>

    <Routes>
      <Route  path='/home' element={<Home/>}/>
    </Routes>
  </Router>


  </>

    )
}

export default App;
